import { Link } from 'react-router-dom';
import PageDefault from '../../../components/PageDefault';

function CadastroCategoria(){
    return(
      <PageDefault>
          <h1>Cadastro de categoria</h1>    
          <Link to="/cadastro/categoria">
            ir para HOme
          </Link>
      </PageDefault>
    )
  }

  export default CadastroCategoria;
